import React from 'react';

function ProjectCountPage(count: number) {
    return <div>You have {count} Projects</div>;
}

const Test = () => {
    var count: number = 0;
    const handleClick = () => {
        count += 1;
        ProjectCountPage(count);
    }
    return(
        <div>
            <button onClick={handleClick}>
                Click me
            </button>
        </div>
    );
};

export default test;
